import React from "react"
import MythicPlusRunCard from "./MythicPlusRunCard"
import styled from "@emotion/native"
import { View } from "react-native"

const Container = styled.View`
    z-index: 0;
`

const BestMythicPlusRuns = ({ characterRuns }) => {
    let elements = []
    try {
        if (characterRuns) {
            characterRuns["mythic_plus_best_runs"].forEach((run, index) => {
                elements.push(<MythicPlusRunCard data={run} key={index} />)
            })
        }
    } catch (e) {
        if (e) {
            console.log(e)
        }
    }
    return <Container>{elements}</Container>
}

export default BestMythicPlusRuns
